import React, { useEffect } from "react";
import ScriptTag from "react-script-tag";
import "./reset.css";
import "./App.css";
import Home from "./pages/Home";
function App() {
  return (
    <div className="App">
      <Home />
      <ScriptTag type="text/javascript" src="./script.js" />
    </div>
  );
}

export default App;
